IF NOT EXISTS (SELECT * FROM sys.objects WHERE object_id = OBJECT_ID(N'[dbo].[Statewide_RA_Factors]') AND type in (N'U'))
BEGIN
CREATE TABLE [dbo].[Statewide_RA_Factors](
	[State] [nvarchar](50) NOT NULL,
	[RA_Adj_Avg_Pre] [float] NOT NULL,
	[Avg_pre] [float] NOT NULL,
	[PLRS] [float] NOT NULL,
	[ARF] [float] NOT NULL,
	[AV] [float] NOT NULL,
	[IDF] [float] NOT NULL,
	[MM] [float] NOT NULL,
	[Market] [nvarchar](50) NOT NULL,
	[Year] [int] NOT NULL
) ON [PRIMARY]
END
GO
/****** Object:  View [dbo].[Statewide_Factor_sum]    Script Date: 3/8/2025 2:51:33 AM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
IF NOT EXISTS (SELECT * FROM sys.views WHERE object_id = OBJECT_ID(N'[dbo].[Statewide_Factor_sum]'))
EXEC dbo.sp_executesql @statement = N'create view [dbo].[Statewide_Factor_sum] as 
select plrs*idf*gcf firs, av*arf*gcf fers, RA_Adj_Avg_Pre, raf.year, raf.state, raf.market from qhp_puf..Statewide_RA_Factors raf join (
select sum(billable_member_months*gcf)/sum(billable_member_months) gcf, state, year, market from gcf
group by state, year, market
) gcf
on raf.state = gcf.state
and raf.year = gcf.year and raf.market = gcf.market
' 
GO
